import React from "react";
import "./style.css"

const MakeCall = () => {
    let JsSIP = require('jssip');

    const socket = new JsSIP.WebSocketInterface('wss://77.104.116.187:7000/');

    let configuration = {
        'uri': '704@admin', // FILL SIP URI HERE like sip:sip-user@your-domain.bwapp.bwsip.io
        'password': '704704', // FILL PASSWORD HERE,
        'sockets': [socket]
    };
    let ua = new JsSIP.UA(configuration);
    console.log('ua', ua);
    // JsSIP.debug.enable('JsSIP:*'); // more detailed debug output
    ua.start();
    console.log(ua._status)
    ua.on('connected', function (e) {
        alert("connected")
    });
// Register callbacks to desired call events
    const eventHandlers = {
        'progress': function (e) {
            console.log('call is in progress');
        },
        'failed': function (e) {
            console.log('call failed with cause: ' + e.data.cause);
        },
        'ended': function (e) {
            console.log('call ended with cause: ' + e.data.cause);
        },
        'confirmed': function (e) {
            console.log('call confirmed');
        }
    };

    let options = {
        'eventHandlers': eventHandlers,
        'mediaConstraints': {'audio': true, 'video': true}
    };

    let session = ua.call('sip:712@admin', options);
    console.log("session", session);

    const onSipConnect = (status) => {
        console.log("window.Strophe.Status", ua._status);
        if (status === ua._status.DISCONNECTED) {
            console.log("Strophe is disconnected.");
        } else if (status === ua._status.CONNECTED) {
            console.log("Strophe is connected.");
        }
    }
    return (

        <React.Fragment>
            <div id="callControl">
                <div id="to">
                    <input id="toField" type="text" placeholder="Enter number here"/>
                </div>
                <div id="connectCall"><i className="fa fa-phone"></i>

                </div>
            </div>
        </React.Fragment>
    )
};

export default MakeCall;
